// App.js
// import React, { useEffect, useState } from 'react';
import { AuthProvider } from './web/AuthContext';
import Logout from './web/cmpts/Logout';
import Login from './web/cmpts/Login';
import Post from './web/cmpts/CreatePost';
import Form from './web/cmpts/FillPreMedicalForm';
import Doct from './web/cmpts/DoctorPage';
import Patient from './web/cmpts/PatientPostView';

function App() {
  return (
    <AuthProvider>
      <Login />
      <Post />
      <Form />
      <Patient />
      <Chat />
      <Doct />
      <Logout />
    </AuthProvider>
  );
}

export default App;
